        <p><strong>Anlisis paso a paso:</strong></p>
        <ol>
          <li><strong>Identifica los lados:</strong> La figura es un rectngulo con lados 5m y 2n. El permetro es la suma de sus cuatro lados: 5m + 2n + 5m + 2n.</li>
